import React, { Component } from 'react'

export default class Notes extends Component {
    render() {
        var allNotes = JSON.parse(localStorage.getItem("allNotes"));
        return (
           
            allNotes.map(note => {
                return(
                     <div>
                         <span>
                         <h3>{note.title}</h3>
                         </span>
                         
                         <p>Last Modified{" "}
              {new Date(note.lastEdited).toLocaleDateString("en-GB", {
                hour: "2-digit",
                minute: "2-digit",
              })}</p>
              <i class="material-icons" style={{}}>delete</i>
              <hr />
                     </div>              
                );
            })
        )
    }
}
